import React from 'react'

function TableRow( {id,name,city,province} ){
    return (
        <tr>
            <th scope="row">{id}</th>
            <td>{props.name}</td>
            <td>{props.city}, {props.province}</td>
        </tr>
    )
}

export default TableRow
